import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

/* Create root element that will render my JS modules in index.html */
const root = ReactDOM.createRoot(document.getElementById('root'));

/* Custom HTML element */
const myFirstElement = <h1>A demo element</h1>

/* Ayyy OOP! But in JS! */
class guy {
    constructor(name) {
        this.brand = name;
    }
}

root.render(myFirstElement); /* Rendering my custom HTML header */
/* Pre-packaged app from Facebook when starting a new project */
// I customized some things like replacing the spinning icon, and changing background and text colors
// Apparently I can't enter text into the element renders
// notice that the latest `root.render` call is what loads
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// ### TODO
